{"image":"425", "date":"0000-00-00", "address": { "town": "Paris", "district": 1, "department": 75, "number": "", "street": "", "legacy": "" }, "didascalie": { "base": "Une visite aux Halles Centrales. A 1 heure du matin.", "ext": "Une visite aux Halles Centrales. A 1 h. du matin. Arrivée du train de légumes. Dans la rue Baltard un train desservait la région de Monthéry et Arpajon arrive tous les matins vers 1 h. Ce train doit être complétement débarrassé par les forts des Halles de façon à déblayer la chaussée avant 3 h., heure à laquelle arrivent les maraîchers qui s&apos;installent sur son emplacement. Le train est composé de 10 à 50 voitures suivant la saison." }},
